import { Typography, Box, Switch } from "@mui/material";


const Nav = (mediaQuery, changeLenguage, language) => {

    const handleLanguageChange = () => {
        if (language === 'es') {
            changeLenguage('en');
        }else{
            changeLenguage('es');
        }
    }

    return (
        <Box
            width="100%"
            display="flex"
            border="1px solid black"
            justifyContent="center"
            alignItems="center"
        >
            <img src={`${process.env.PUBLIC_URL}/img/logo.png`} alt="Logo" 
                style={{ width: '25%', height: '25%', maxWidth: "25vw", maxHeight: "10vh" }} 
            />

            <Switch onChange={handleLanguageChange}></Switch>
            <Typography variant="h1">Nav</Typography>
        </Box>
    );
}

export default Nav;
